import React from 'react';
import { useSelector, useDispatch } from 'react-redux';
import { Link } from 'react-router-dom';

const Nastavnik = (props) => {
  const nastavnik = useSelector((state) => state.nastavnik);
  const dispatch = useDispatch();

  return (
    <div>
      <p>
        {props.ime} {props.prezime}
      </p>
      <Link
        to={'/nastavnici/' + nast.idNastavnik}
        onClick={() => {
          dispatch(ucitajNastavnika(nast.idNastavnik));
        }}
      >
        Details
      </Link>
    </div>
  );
};

export default Nastavnik;
